import { Link } from "react-router-dom";
import fetchMovieDetails from '../services/movieApi'

export default function MovieDetailsPage() {
    return (
        <div>
             <Link to='/'>Home</Link>
         <br></br>
        <Link to='/movies' >Movies</Link>
        fetchMovieDetails()
        </div>
    )
}
